INSERT INTO `static_page_i18n` VALUES ('Willkommen','Das ist die standardmäßige Homepage von AtoM. Dabei handelt es sich um eine Beta-Version, die nach wie vor weiter entwickelt und getestet wird.\n\nAtoM ist eine vollständig webbasierte Anwendung zur Archiverschließung. Sie basiert auf den Standards des <a href=\"http://www.ica.org/\">Internationalen Archivrats</a> (ICA). <i>AtoM</i> ist ein Akronym für <i>Access to Memory</i>.\n\nDer ICA und seine <a href=\"http://ica-atom.org/about#partners\">Projekpartner</a> machen diese Anwendung als Open-Source-Software zugänglich, um archivischen Institutionen eine frei zugänglichen und einfach zu benutzende Möglichkeit anzubieten, ihre Bestände online vorzustellen. Auf der Seite <a href=\"about\">Über AtoM</a> erfahren Sie Näheres zum Projekt.\n\n<h2>Hilfe</h2>\n\nBenützen Sie das online <a href=\"http://ica-atom.org/docs\">Benützerhandbuch</a> um mehr über die Funktionen dieses Programms zu erfahren oder wählen Sie die Schaltfläche\n<i>blättern</i>, um einige Beispieldaten zu sehen.',7,'de'),('Welcome','This is the default homepage for AtoM.\n\nAtoM is a fully web based archival description application that is based on <a href=\"http://www.ica.org/\">International Council on Archives</a> (ICA) standards. <i>AtoM</i> is an acronymn for <i>Access to Memory</i>.\n\nThe ICA and its <a href=\"http://ica-atom.org/about#partners\">project collaborators</a> are making this application available as open source software to provide archival institutions with a free and easy to use option for putting their archival collections online. See the <a href=\"about\">about page</a> to learn more about the AtoM project.\n\nSee the online <a href=\"http://ica-atom.org/docs\">documentation</a> to learn more about using the software or press the <i>browse</i> button on the right to view some sample data.',7,'en'),('Bienvenido','Esta es la página por defecto de AtoM.\n\nAtoM es una aplicación diseñada para la descripción de archivos con soporte web completo basada en los estándares del <a href=\"http://www.ica.org/\">Consejo Internacional de Archivos</a> (CIA/ICA). <i>AtoM</i> es el acrónimo de <i>Access to Memory</i> (Acceso a la Memoria).\n\nEl CIA/ICA y sus <a href=\"http://ica-atom.org/about#partners\">colaboradores</a> en el proyecto están desarrollando esta aplicación de recursos de software abierto para que las instituciones archivísticas puedan hospedar online su información de un modo fácil y gratuito. Consulte <a href=\"acerca\">about page</a> para conocer más información acerca del proyecto AtoM.\n\nConsulte la <a href=\"http://ica-atom.org/docs\">documentación</a> online para saber más acerca de cómo usar el software o presione el botón <i>navegar</i> situado en la parte derecha de la pantalla para ver algunos ejemplos',7,'es'),('Bienvenue','Vous êtes sur la page d’accueil d’AtoM. Il s’agit d’une version bêta encore en phase active de développement et de test.\n\nAtoM est une application Web de description archivistique qui repose sur les normes du <a href=\"http://www.ica.org/ \"> Conseil International des Archives</a>(CIA). <i>AtoM</i> est un acronyme signifiant: <i>«  Access to Memory  »</i> [Accès à la Mémoire].\n\nLe CIA et <a href=\"http://ica-atom.org/about#partners\">ses partenaires associés au projet</a> veillent à faire de cette application un logiciel libre afin de fournir aux services d’archives une solution gratuite et facile d’emploi pour la mise en ligne de leurs fonds d’archives. Pour en apprendre plus sur le projet du CIA, voyez la <a href=\"about\">page « À propos »</a>.\n\nConsultez la <a href=\"https://www.ica-atom.org/doc/Main_Page/fr \">documentation en ligne</a> pour en apprendre plus sur l’utilisation du logiciel , ou bien cliquez sur le bouton <i>« Naviguer »</i> à droite pour voir quelques exemples de données en ligne.',7,'fr'),('Benvido','Esta é a páxina por defecto de AtoM. Esta é a versión beta que aínda esta en desenvolvemento e proba.\n\nAtoM é unha aplicación completa baseada na web para a descrición arquivística. Emprega os estándares do <a href=\"http://www.ica.org/\">Consello Internacional de Arquivos </a> (ICA). <i>AtoM</i> é o acrónimo de <i>Acceso á Memoria </i>.\n\nO ICA e os seus <a href=\"http://ica-atom.org/about#partners\">colaboradores no proxecto </a> están traballando para que a aplicación sexa dispoñible como software de código aberto e proporcione ás institucións arquivísticas unha opción de balde e doada de empregar para publicar en liña as súas coleccións arquivísticas. Vexa a <a href=\"about\">páxina about</a> para aprender máis sobre o proxecto AtoM.\n\nVexa a documentación <a href=\"http://ica-atom.org/docs\">online</a> para aprender máis sobre o uso do software e prema o botón <i>examinar</i> á dereita para ver algúns exemplos.',7,'gl'),('Selamat Datang','Ini adalah halaman utama AtoM. Ini adalah versi beta yang masih dalam pengembangan dan pengujian secara aktif.\n\nAtoM adalah aplikasi berbasis web untuk deskripsi arsip yang berdasar pada <a href=\"http://www.ica.org/\"> International Council on Archives</a> (ICA) standar. <i>AtoM</i> adalah singkatan dari <i>Access to Memory</i>.\n\nICA dan rekanannya <a href=\"http://ica-atom.org/about#partners\">proyek  kolaborator</a> membuat aplikasi ini sebagai aplikasi <i>open source</i> agar dapat mendukung institusi arsip secara terbuka dan memudahkan untuk mengelola koleksi arsip mereka secara online.\n\nLihat <a href=\"about\">Tentang AtoM</a> untuk mempelajari lebih lanjut tentang proyek aplikasi AtoM.\n\nLihat online <a href=\"http://ica-atom.org/docs\">dokumentasi</a> untuk mempelajari lebih lanjut menggunakan aplikasi ini atau gunakan <i>browse</i> pada bagian kanan untuk melihat beberapa sample data.',7,'id'),('Benvenuti','Questa è la pagina predefinita di AtoM.\n\nAtoM è un applicazione per la descrizione archivistica interamente online, basata sugli standard dell\'<a href=\"http://www.ica.org/\">International Council on Archives</a> (ICA). AtoM è un acronimo per <i>Access to Memory</i>.\n\nICA e i suoi <a href=\"http://ica-atom.org/about#partners\">collaboratori nel progetto</a> stanno sviluppando questa applicazione open source per fornire alle istituzioni archivistiche una semplice e gratuita opzione per rendere disponibile in linea il loro patrimonio archivistico. Si veda la pagina delle <a href=\"about\">informazioni</a> per ulteriori indicazioni sul progetto AtoM.\n\nÈ possibile consultare la <a href=\"http://ica-atom.org/docs\">documentazione</a> per informazioni su come utilizzare il software o, utilizzando il pulsante <i>naviga</i> sulla destra, è possibile vedere alcuni esempi.',7,'it'),('ようこそ','AtoMは、<a href=\"http://www.ica.org/\">国際文書館評議会</a> （ICA） の基準に基づいた完全にウェブベースのアーカイブズ記述のアプリケーションです。Atomは、Access to Memoryの略語です。\n\nICAと<a href=\"http://ica-atom.org/about#partners\"> プロジェクトの協力者は、</a>アーカイブ機関にこのアプリケーションをアーカイブズコレクションをオンライン化するための手段として使用するための無料で使いやすいオープンソースソフトウェアとして利用できるようにしています。ICA Atomのプロジェクトの詳細を学ぶためには <a href=\"about\">about page</a> を参照してください。\n\nこのソフトウェアの使用法をもっと知るために、<a href=\"http://ica-atom.org/docs\">documentation</a> オンラインマニュアルを参照するか、いくつかのサンプルデータを表示するために右側の <i>browse</i> ボタンをクリックしてしてください',7,'ja'),('მოგესალმებით','თქვენ იმყოფებით AtoM პროგრამის საწყის გვერდზე. ეს გახლავთ ჯერ კიდევ ბეტა ვერსიის პროგრამული უზრუნველყოფა, რომლის დახვეწა და ტესტირება ჯერ კიდევ მიმდინარეობს.\n\nAtoM არის მთლიანად ვებზე დაფუძნებული პროგრამა საარქივო აღწერებისათის, რომელიც დაფუძნებულია <a href=\"http://www.ica.org/\">არქივების საერთაშორისო საბჭოს</a> (ICA) სტანდარტებზე. <i>AtoM</i> არის <i>Access to Memory</i> აკრონიმი.\n\nICA და მისი <a href=\"http://ica-atom.org/about#partners\">პროექტი გათვლილია</a> რათა პროგრამა იყოს უფასო და ღია კოდის სოფტი რათა ნებისმიერ ფონდშემნახველ ორგანიზაციას ქონდეს შესაძლებლობა მარტივად დანერგოს და გამოიყენოს ის ონლაინ კოლექციებისათის. იხილეთ <a href=\"about\">ჩენს შესახებ</a> AtoM პროექტის შესახებ მეტი ინფორმაციისათვის.\n\nიხილეთ <a href=\"http://ica-atom.org/docs\">დოკუმენტაცია</a> რათა გაეცნოთ პროგრამას დეტალურად ან დააჭირეთ <i>მოძიება</i> ღილაკს მარჯვენა მხარეს მაგალითების სანახავად.',7,'ka'),('환영합니다','이 홈페이지는 AtoM 1.0.7.판의 홈페이지이다. 이 보존기록프로그램은 현재 개발시험중인 초기 베타버전이다. \n\nAtoM은 \'국제기록보존기구회의\'(ICA) 표준에 기초한 웹기반 보존기록기술 어플리케이션이다.AtoM은 기억에 대한 접근(Access to Memory)의 약어이다.\n\nICA와 ICA의 \'프로젝트 협력자\'들은 기록보존기관들이 소장 기록물을 쉽게 무료로 온라인으로 정리제공할 수 있게 이 어플리케이션을 오픈소스 소프트웨어로 개발하고 있다. AtoM 프로젝트에 대해 더 알고 싶으면  \'위 페이지\'를 보시오.  \n\n이 소프트웨어 사용에 대해 더 알고 싶으면 온라인 \'도큐멘테이션\'을 보고, 샘플 데이터를 보려면 오른쪽 \'찾아보기\' 단추를 누르시오.    ',7,'ko'),('Welkom','Dit is de standaard homepage voor AtoM. Dit is een beta versie, nog onder ontwikkeling en testen.\n\nAtoM is een volledig web based applicatie voor het beschrijven van archieven, gebaseerd op <a href=\"http://www.ica.org/\">International Council on Archives</a> (ICA) standaarden. <i>AtoM</i> is een acroniem voor <i>Access to Memory</i>.\n\nDe ICA en zijn <a href=\"http://ica-atom.org/about#partners\">project partners</a> stellen deze applicatie beschikbaar als open source software, om archiefinstellingen te voorzien van een vrij en gemakkelijk te gebruiken voorziening om hun archiefcollecties online te zetten. Zie de <a href=\"about\">over pagina</a> voor meer informatie over het AtoM project.\n\nZie de online <a href=\"http://ica-atom.org/docs\">documentatie</a> voor meer informatie over het gebruik van de software of toets de <i>browse</i> knop aan de rechterkant om enkele voorbeelden te bekijken.',7,'nl'),('Witamy','To jest strona domowa AtoM. Jest to wersja beta, nadal podlegająca aktywnym testom i zmianom.\n\nAtoM jest opartym w pełni na technologii web oprogramowaniem do opisu archiwalnego bazującym na standardach <a href=\"http://www.ica.org/\">Międzynarodowej Rady Archiwów (ICA)</a>. <i>AtoM</i> jest akronimem angielskich słów <i>Access to Memory</i>.\n\nMiędzynarodowa Rada Archiwów, wraz z <a href=\"http://ica-atom.org/about#partners\">partnerami projektu</a> tworzą to oprogramowanie na zasadach open source, aby umożliwić instytucjom archiwalnym łatwą i swobodną metodę publikowania swoich kolekcji online.\n\nZapoznajcie się ze stroną <a href=\"about\">O projekcie</a> aby dowiedzieć się więcej na temat AtoM.\n\nZachęcamy również do skorzystania z <a href=\"http://ica-atom.org/docs\">dokumentacji</a> aby dowiedzieć się więcej na temat użytkowania programu lub kliknięcia odnośnika <i>browse</i> po prawej stronie, aby przeglądać przykładowe dane demonstracyjne.',7,'pl'),('Bem-vindo','Esta é a página padrão para o AtoM.\n\nAtoM é um aplicativo de descrição arquivística integralmente voltado para web e baseado em <a href=\"http://www.ica.org/\">Conselho Internacional de Arquivos</a> (CIA) normas. <i>AtoM</i> é um acrônimo para <i>Access to Memory [Acesso à Memória]</i>.\n\nO CIA e seus <a href=\"http://ica-atom.org/about#partners\">colaboradores neste projeto</a> estão disponibilizando este aplicativo como software de fonte aberta para prestar apoio a entidades custodiadoras como uma opção gratuita e de fácil uso para colocar seus acervos arquivísticos online. Veja <a href=\"about\">about page</a> para saber mais sobre o projeto AtoM.\n\nVeja a <a href=\"http://ica-atom.org/docs\">documentação</a> para saber mais como utilizar o software ou pressione o botão <i>navegador</i> no lado direito para ver alguns exemplos.',7,'pt'),('Dobrodošli','To je privzeta domača stran programa AtoM. Gre za beta verzijo, ki se aktivno razvija in testira.\n\nAtoM je v celoti spletni arhivski program, ki temelji na standardih Mednarodnega arhivskega sveta (ICA) <a href=\"http://www.ica.org/\">International Council on Archives</a> (ICA) standards. <i>AtoM</i> Atom je kratica za dostop do pomnilnika.\n\nS pomočjo ICA in <a href=\"http://ica-atom.org/about#partners\">drugih sodelavcev pri projektu</a> je program dostopen kot odprtokodna programska oprema, ki institucijam z arhivi ponuja brezplačno in preprosto možnost objave svojih arhivskih zbirk na spletu. Glejte <a href=\"about\">o strani</a> za več informacij o projektu AtoM.\n\nOglejte si spletno dokumentacijo <a href=\"http://ica-atom.org/docs\">dokumentacija</a> za več informacij o uporabi programa ali kliknite gumb <i>išči</i> na desni strani za ogled primerov.',7,'sl'),('ยินดีต้อนรับ','นี่คือ default homepage ของ AtoM รุ่นเบต้าซึ่งยังอยู่ภายใต้การพัฒนาและการทดสอบ\n\nAtoM เป็นเวปไซที่เป็นคลังเก็บคำอธิบายของจดหมายเหตุ ตาม <a href=\"http://www.ica.org/\">International Council on Archives</a> (ICA) standards. <i>AtoM</i> เป็นตัวย่อมาจากคำว่า <i>Access to Memory</i>.\n\nICA และ<a href=\"http://ica-atom.org/about#partners\"> ผู้ร่วมทำ project </a> ร่วมกันพัฒนาแอพพริเคชันนี้ในรูปแบบของ open source software เพื่อให้สถาบันจดหมายเหตุสามารถรวบจดหมายเหตุออนไลน์ได้ง่ายขึ้นโดยไม่เสียค่าใช้จ่าย ดู<a href=\"about\"> about page </a> เพื่อเรียนรู้เพิ่มเติมเกี่ยวกับ AtoM project\n\nดูออนไลน์ <a href=\"http://ica-atom.org/docs\"> documentation</a>  เพื่อเรียนรู้เพิ่มเติมเกี่ยวกับการใช้ซอฟแวร์ หรือกดปุ่ม <i>browse</i> ที่ด้านบนขวาเพื่อดูข้อมูลตัวอย่าง',7,'th'),('حول',NULL,8,'ar'),('Informacije',NULL,8,'bs'),('Quant a',NULL,8,'ca'),('Sobre',NULL,8,'ca@valencia'),('Ynghylch',NULL,8,'cy'),('Über','Dies ist die vorgegebene Seite <i>Über</i> der Open-Source Anwendung zur archivischen Erschließung AtoM. Für den Einstieg in AtoM benützen Sie die <a href=\"http://ica-atom.org/docs\">Dokumentation</a>. Hier erfahren Sie, wie Sie die Anwendung an die Gestaltung ihrer Webseite anpassen und editieren können.\n\nAtoM ist ein <a href=\"http://ica-atom.org/about#partners\">gemeinschaftliches Projekt</a>. Es möchte der internationalen archivarischen Gemeinschaft eine freie, auf Open-Source basierende Software-Anwendung zur Verfügung stellen, um Archivbestände in Übereinstimmung mit den ICA-Standards erschließen zu können.\n\nZiel ist es, eine einfache, vielsprachige, komplett webbasierte Anwendung zur Verfügung zu stellen, die es Institutionen erlaubt, ihre Archivbestände online vorzustellen.',8,'de'),('Über',NULL,8,'de-CH'),('Σχετικά',NULL,8,'el'),('About','This is the default <i>About</i> page for the AtoM open source archival description application. See the online <a href=\"http://ica-atom.org/docs\">documentation</a> to learn how to get started with AtoM, including how to customize and edit this page to suit your own website.\n\nAtoM is a <a href=\"http://ica-atom.org/about#partners\">collaborative project</a> with the aim to provide the international archival community with a free, open source software application to manage archival descriptions in accord with ICA standards.\n\nThe goal is to provide an easy to use, multilingual application that is fully web based and will allow institutions to make their archival collections available online.',8,'en'),('Acerca','Ésta es la página por defecto <i>Acerca</i> de la aplicación para descripción archivística de código abierto AtoM. Para información sobre cómo utilizar AtoM, personalizar y editar esta página según las características de su propio sitio Web, consulte <a href=\"http://ica-atom.org/docs\">documentation</a> .\n\nEl proyecto AtoM <a href=\"http://ica-atom.org/about#partners\">collaborative project</a> tiene por objetivo proporcionar a la comunidad archivística internacional una aplicación gratuita de código abierto para la administración descripciones archivísticas en cumplimiento con estándares ICA.\n\nLa meta es poner a disposición del usuario una aplicación multilingüe, de fácil uso y situada en la red, que permita a las instituciones publicar sus colecciones archivísticas en línea.',8,'es'),('Buruz',NULL,8,'eu'),('درباره ما',NULL,8,'fa'),('À propos','Vous êtes sur la page <i>À propos</i> du logiciel libre de description archivistique AtoM. Voir la <a href=\"http://ica-atom.org/docs\">documentation en ligne </a> pour apprendre à utiliser AtoM, l\'adapter à vos besoins et modifier cette page afin qu\'elle convienne à votre propre site Web.\n\nAtoM est un <a href=\"http://ica-atom.org/about#partners\">projet collaboratif</a> ayant pour but de fournir à la communauté archivistique internationale une application gratuite, disponible en code source libre, permettant de gérer des descriptions archivistiques conformément aux normes de l\'ICA.\n\nLe but est de fournir une application facile à utiliser, multilingue et entièrement basée sur le Web qui permettra aux institutions de rendre accessible en ligne leurs collections archivistiques.',8,'fr'),('Acerca',NULL,8,'gl'),('Informacije',NULL,8,'hr'),('Info',NULL,8,'hu'),('Tentang Kami',NULL,8,'id'),('Um',NULL,8,'is'),('Riguardo','Questa è la pagina predefinita per le <i>Informazioni su</i> AtoM, un\'applicazione open-source per la descrizione archivistica. Si veda la <a href=\"http://ica-atom.org/docs\">documentazione</a> in linea per informazioni su come iniziare con AtoM, come personalizzare e tradurre questa pagina per adattarla al proprio sito web.\n\nAtoM è un <a href=\"http://ica-atom.org/about#partners\">progetto collaborativo</a> con lo scopo di mettere a disposizione della comunità archivistica internazionale un software gratis, libero e open source per gestire le descrizioni archivistiche nel rispetto degli standard ICA.\n\nL\'obiettivo è fornire un\'applicazione semplice e multilingua, accessibile interamente online e che permetta alle istituzioni di rendere fruibili online i propri fondi.',8,'it'),('このウェブサイトについて',NULL,8,'ja'),('შესახებ',NULL,8,'ka'),('About','이 디폴트 페이지는 AtoM 오픈소스 보존기록 기술 어플리케이션 소개 페이지이다. 이 AtoM 사용에 대해 배우고 싶으면 온라인 \'도큐멘테이션\'을 보라. 여기에는 이 페이지를 당신의 웹사이트에 맞춰 맞춤편집하는 방법이 포함되어 있다.\n\nAtoM은 국제기록보존 사회에 ICA 표준에 따라 보존기록 기술을 관리할 수 있게 하는 무료 오픈소스 소프트웨어 어플리케이션을 제공하려는 목적으로 추진된 합동 프로젝트이다.\n\n이 프로젝트의 목적은 웹기반으로 하여 기록보존기관이 소장 기록물을 손쉽게 온라인으로 제공할 수 있게 하는 사용하기 쉬운 다중언어 어플리케이션을 제공하는데 있다.',8,'ko'),('За',NULL,8,'mk'),('Over','Dit is de standaard <i>over...</i> pagina voor de AtoM open-source archivistisch beschrijvingsapplicatie. Kijk naar de online <a href=\"http://ica-atom.org/docs\">documentatie</a> om te leren hoe van start te gaan met deze applicatie, inclusief het aanpassen en bewerken van deze pagina om binnen uw eigen webpagina in te passen.\n\nAtoM is een <a href=\"http://ica-atom.org/about#partners\">samenwerkingsproject</a> met het doel om de internationale archiefwereld te voorzien van een vrij, open-source software applicatie om hun archiefbeschrijvingen te beheren conform de ICA-standaarden.\n\nHet doel is om een eenvoudig te gebruiken, meertalige applicatie, dat volledig web-gebaseerd is beschikbaar te stellen. Het geeft instellingen de mogelijkheid om hun archiefcollecties online beschikbaar te stellen.',8,'nl'),('O...',NULL,8,'pl'),('Sobre','Essa é a página padrão <i>Sobre</i> do AtoM, um aplicativo de código-fonte aberto para descrição arquivística. Acesse a <a href=\"http://ica-atom.org/docs\">documentação</a> online para aprender como começar a usar o AtoM, incluindo como personalizar e editar essa página para incluí-la em seu site.\n\nAtoM é <a href=\"http://ica-atom.org/about#partners\">projeto colaborativo</a> que visa prover a comunidade arquivística internacional de um software aplicativo gratuito e de código-fonte aberto, para gerenciamento de descrições arquivísticas em conformidade às normas do Conselho Internacional de Arquivos (ICA).\n\nO objetivo é disponibilizar um aplicativo fácil de usar, multilíngue, e totalmente baseado na web, permitindo que instituições possam disponibilizar seus acervos arquivísticos on-line.',8,'pt'),('Sobre',NULL,8,'pt_BR'),('O programu','To je prednastavljena <i>About</i> stran za AtoM odprtokodno aplikacijo za popisovanje arhivskega gradiva. Glej \"online\" <a href=\"http://ica-atom.org/docs\">documentation</a>, kjer izveš več o tem kako začeti delo s programom, vključno s tem, kako preoblikovati in urediti to stran za lastne potrebe.\n\nICA in njegovi <a href=\"http://ica-atom.org/about#partners\">sodelavci v projektu</a> so pripravili za potrebe mednarodne arhivske skupnosti prosto dostopno in odprtokodno aplikacijo za upravljanje arhivskih opisov v skladu z ICA standardi.\n\nNaš cilj je pripraviti uporabno, večjezikovno spletno aplikacijo, ki bo omogočala ustanovam \"on line\" predstavitev njihovih arhivskih zbirk.',8,'sl'),('О',NULL,8,'sr'),('Om',NULL,8,'sv'),('Ma\'lumot',NULL,8,'uz'),('Về',NULL,8,'vi'),('关于',NULL,8,'zh'),('سياسة الخصوصية',NULL,9,'ar'),('Politika privatnosti',NULL,9,'bs'),('Polisi Preifatrwydd',NULL,9,'cy'),('Privacy Policy','##Website visitors##\n\nThis Access to Memory (AtoM) site is designed to allow users to browse and search for the holdings of archives, libraries and museums. Public users will not be asked to log in and will not be asked for any personally identifying information.\n\nHowever, like many modern websites, AtoM collects cookies in order to enable browsing and loading of certain types of content. A cookie is a string of information that a website stores on a visitor’s computer, and that the visitor’s browser provides to the website each time the visitor returns. Visitors to AtoM sites who do not wish to have cookies placed on their computers should set their browsers to refuse cookies. However, certain features may not function properly without the aid of cookies.\n\nAtoM supports integration with Google Analytics (https://www.google.com/analytics/) for the purposes of gathering statistics on page views, site usage, user location, and other data on site visits. All data collected by Google Analytics are stored and processed by Google, according to the Google Ads Data Processing Terms. (https://privacy.google.com/businesses/processorterms/)\n\nNone of the information gathered through the use of cookies or Google Analytics is used for any purpose other than the ones described above.\n\n##Logged-in users##\n\nUsers who log in have user accounts with usernames and passwords. These data are collected solely for the purpose of enabling users to log in to the software and are not disclosed to third parties. All AtoM user passwords are stored in encrypted form to enhance data security.',9,'en'),('Politique de confidentialité',NULL,9,'fr'),('Politika privatnosti',NULL,9,'hr'),('Kebijakan Privasi',NULL,9,'id'),('プライバシーポリシー',NULL,9,'ja'),('Политика за приватност',NULL,9,'mk'),('Política de privacidade',NULL,9,'pt'),('Política de Privacidade',NULL,9,'pt_BR'),('Sekretesspolicy',NULL,9,'sv');
